import React from "react";
import { connect } from "react-redux";
import {getMeetings} from '../actions/index'
//import {Link} from 'react-router-dom';


function getPatients(props) {
  return (

    <div className="getPatients">
        <button type="button" className="btn btn-outline-info" onClick={()=>{props.submit()}}>View</button>
        {
            props.meetingFetch==='Success'?<div>{JSON.stringify(props.users.data[0])}</div>:null
        }
    </div>
  );
}

const mapDispatchToProps = dispatch => {
    return {
        submit:()=>{
            dispatch(getMeetings())
        }
    }
}

const mapStateToProps = state => {
    const users=state.users.data
    const meetingFetch=state.meetingFetch
    console.log(users)
    return {meetingFetch,users}
}

export default connect(mapStateToProps,mapDispatchToProps)(getPatients);
